
UPDATE S23804121.Students_ProfG_FP
SET Last4SSN_Encrypted = ENCRYPTBYPASSPHRASE('YourStrongPassphrase!', Last4SSN_Plaintext)
WHERE Last4SSN_Encrypted IS NULL AND Last4SSN_Plaintext IS NOT NULL;

SELECT 
    StudentID,
    FirstName,
    LastName,
    CONVERT(VARCHAR(4), DECRYPTBYPASSPHRASE('YourStrongPassphrase!', Last4SSN_Encrypted)) AS Last4SSN_Decrypted
FROM 
    S23804121.Students_ProfG_FP
WHERE 
    Last4SSN_Encrypted IS NOT NULL;



